import "./styles.css";
import img1 from "../../images/tech-travel/train1.png";
import img4 from "../../images/albania/albania2.png";

import img2 from "../../images/albania/albania4.png";
import img7 from "../../images/tech-travel/tech.png";
import img5 from "../../images/tirana/tirana3.png";
import img6 from "../../images/albania/albania6.png";
import img3 from "../../images/albania/albania8.png";

const urlBois = [
  {
    url: img1,
  },
  {
    url: img2,
  },
  {
    url: img3,
  },
  {
    url: img4,
  },
  {
    url: img5,
  },
  {
    url: img6,
  },
  {
    url: img7,
  },
];

export default urlBois;
